$.ack=H.a(["Nowadays you don't go around on the street kicking people, punching people \u2014 because if you do (makes gun shape with hand), well that's it \u2014 I don't care how good you are.\nBruce Lee interview on the Pierre Berton Show (1971)","When I look around I always learn something, and that is to be yourself always, express yourself, and have faith in yourself. Do not go out and look for a successful personality and duplicate him. Now that seems to be the prevalent thing happening in Hong Kong, like they always copy mannerism, but they never start from the root of his being and that is, how can I be me?\nBruce Lee",'You know what I want to think of myself? As a human being. Because, I mean I don\'t want to be like "As Confucius say," but under the sky, under the heavens there is but one family. It just so happens man that people are different.\nBruce Lee: The Lost Interview (1971)',"When you're talking about fighting, as it is, with no rules, well then, baby you'd better train every part of your body!\nBruce Lee: The Lost Interview (1971)","All types of knowledge, ultimately mean self knowledge.\nBruce Lee: The Lost Interview (1971)","When I look around, I always learn something: to be always yourself, and to express yourself, to have faith in yourself. Do not go out and look for a successful personality and duplicate it.\nRadio interview with Ted Thomas (1972)","Boards don't hit back.\nAs \"Mr. Lee\" in Enter the Dragon (1973); Bruce Lee's character said this to Robert Wall's character \"O'Hara\", after the latter had broken a board in the air with his fist in an act of attempted intimidation.",'A good martial artist does not become tense, but ready. Not thinking, yet not dreaming. Ready for whatever may come. When the opponent expands, I contract; and when he contracts, I expand. And when there is an opportunity, "I" do not hit, "it" hits all by itself.\nBruce Lee: Enter the Dragon (1973); In a conversation with an older member of the temple.',"Don't think, feel....it is like a finger pointing a way to the moon. Don't concentrate on the finger or you will miss all that heavenly glory!\nBruce Lee: Enter the Dragon (1973); In a training session with one of the temple students.",'Man, the living creature, the creating individual, is always more important than any established style or system.\nAs quoted in "From Wing Chun to Jeet Kune Do" by Jesse R. Glover in Black Belt Vol. 31, No. 9 (September 1993),',"Use only that which works, and take it from any place you can find it.\nAs quoted in Bruce Lee: Fighting Spirit (1994) by Bruce Thomas (1994),","Forget about winning and losing; forget about pride and pain. Let your opponent graze your skin and you smash into his flesh; let him smash into your flesh and you fracture his bones; let him fracture your bones and you take his life. Do not be concerned with escaping safely \u2014 lay your life before him.\nAs quoted in Bruce Lee: Artist of Life (1999) edited by John R. Little,","There are no limits. There are plateaus, but you must not stay there, you must go beyond them. If it kills you, it kills you. A man must constantly exceed his level.\nAs quoted in The Art of Expressing the Human Body (1998) edited by John R. Little,","Don't get set into one form, adapt it and build your own, and let it grow, be like water. Empty your mind, be formless, shapeless \u2014 like water. Now you put water in a cup, it becomes the cup; You put water into a bottle it becomes the bottle; You put it in a teapot it becomes the teapot. Now water can flow or it can crash. Be water, my friend.\nBruce Lee: A Warrior's Journey (2000); here, Lee was reciting lines he wrote for his short lived role on the TV series Longstreet.",'For a momentThe surrounding utters no sound.Time ceases.The Paradise of Dreams come true.\n"For A Moment", Bruce Lee\'s hand-written poem, from Bruce Lee Papers \u2014 as quoted in Bruce Lee: Artist of Life (2001) edited by John Little,',"Jeet Kune Do favors formlessness so that it can assume all forms and since Jeet Kune Do has no style, it can fit in with all styles. As a result, Jeet Kune Do utilizes all ways and is bound by none and, likewise, uses any techniques which serve its end.","When there is freedom from mechanical conditioning, there is simplicity. The classical man is just a bundle of routine, ideas and tradition. If you follow the classical pattern, you are understanding the routine, the tradition, the shadow \u2014 you are not understanding yourself.","Do not deny the classical approach, simply as a reaction, or you will have created another pattern and trapped yourself there.",'Truth has no path. Truth is living and, therefore, changing. Awareness is without choice, without demand, without anxiety; in that state of mind, there is perception. To know oneself is to study oneself in action with another person. Awareness has no frontier; it is giving of your whole being, without exclusion.\nThis statement probably derives from a famous one of Jiddu Krishnamurti: "Truth is a pathless land."',"To contemplate a thing implies maintaining oneself OUTSIDE it, resolved to keep a distance between it and ourselves.","Running water never grows stale. So you just have to 'keep on flowing.'","If one loves, one need not have an ideology of love.","The happiness that is derived from excitement is like a brilliant fire \u2014 soon it will go out. Before we married, we never had the chance to go out to nightclubs. We only spent our nights watching TV and chatting. Many young couples live a very exciting life when they are in love. So, when they marry, and their lives are reduced to calmness and dullness, they will feel impatient and will drink the bitter cup of a sad marriage.","Of course you\u2019re there. Death is always there. So why was I afraid? Your leap is swift. Your claws are sharp and merciful. What can you take from me which is not already yours? . . . Everything I have done until now has been fruitless. It has led to nothing. There was no other path except that it led to nothing \u2014 and before me now there is only one real fact \u2014 Death. The truth I have been seeking \u2014 this truth is Death. Yet Death is also a seeker. Forever seeking me. So \u2014 we have met at last. And I am prepared. I am at peace. Because I will conquer death with death.","Neither. I think of myself as a human being.","The Three Stages of Cultivation \u2014 The first is the primitive stage. It is a stage of original ignorance in which a person knows nothing about the art of combat. In a fight, he simply blocks and strikes instinctively without a concern for what is right and wrong. Of course, he may not be so-called scientific, but, nevertheless, being himself, his attacks or defenses are fluid. The second stage \u2014 the stage of sophistication, or mechanical stage \u2014 begins when a person starts his training. He is taught the different ways of blocking, striking, kicking, standing, breathing, and thinking \u2014 unquestionably, he has gained the scientific knowledge of combat, but unfortunately his original self and sense of freedom are lost, and his action no longer flows by itself. His mind tends to freeze at different movements for calculations and analysis, and even worse, he might be called \u201cintellectually bound\u201d and maintain himself outside of the actual reality. The third stage \u2014 the stage of artlessness, or spontaneous stage \u2014 occurs when, after years of serious and hard practice, the student realizes that after all, gung fu is nothing special. And instead of trying to impose on his mind, he adjusts himself to his opponent like water pressing on an earthen wall. It flows through the slightest crack. There is nothing to try to do but try to be purposeless and formless, like water. All of his classical techniques and standard styles are minimized, if not wiped out, and nothingness prevails. He is no longer confined.","Using no way as way; Having no limitation as limitation.",'In Jeet Kune Do, it\u2019s not how much you have learned, but how much you have absorbed from what you have learned. It is not how much fixed knowledge you can accumulate, but what you can apply livingly that counts. \u2018Being\u2019 is more valued than "doing".',"You have to keep your reflexes so that when you want it \u2014 it\u2019s there. When you want to move \u2014 you are moving. And when you move, you are determined to move! Not accepting even one inch less than 100 percent of your honest feelings. Not anything less than that. So that is the type of thing you have to train yourself into. To become one with your feelings so that, when you think \u2014 it is.","In life, what more can you ask for than to be real? To fulfill one\u2019s potential instead of wasting energy on [attempting to] actualize one\u2019s dissipating image, which is not real and an expenditure of one\u2019s vital energy. We have great work ahead of us, and it needs devotion and much, much energy. To grow, to discover, we need involvement, which is something I experience every day \u2014 sometimes good, sometimes frustrating. No matter what, you must let your inner light guide you out of the darkness.","None whatsoever.\nWhen asked what major religion he was affiliated with in 1972 by journalist Alex Ben Block,","To be perfectly frank, I really do not.\nWhen asked if he believed in God,","I believe in sleeping.\nWhen asked by his brother Robert if he believed in God,","There is no such thing as maturity. There is instead an ever-evolving process of maturing. Because when there is a maturity, there is a conclusion and a cessation. That\u2019s the end. That\u2019s when the coffin is closed. You might be deteriorating physically in the long process of aging, but your personal process of daily discovery is ongoing. You continue to learn more and more about yourself every day.","I have come to discover through earnest personal experience and dedicated learning that ultimately the greatest help is self-help; that there is no other help but self-help\u2014 doing one\u2019s best, dedicating one\u2019s self wholeheartedly to a given task, which happens to have no end but is an ongoing process. I have done a lot during these years of my process. A swell in my process, I have changed from self-image actualization to self-actualization, from blindly following propaganda, organized truths, etc. to searching internally for the cause of my ignorance.","Whether or not we can get together, remember well that art \u201clives\u201d where absolute freedom is. With all the training thrown to nowhere, with a mind (if there is such a verbal substance) perfectly unaware of its own working, with the \u201cself\u201d vanishing nowhere, the art of JKD attains its perfection.","You must have complete determination. The worst opponent you can come across is one whose aim has become an obsession. For instance, if a man has decided that he is going to bite off your nose no matter what happens to him in the process, the chances are he will succeed in doing it. He may be severely beaten up, too, but that will not stop him from carrying out his objective. That is the real fighter.","Walk on.",'Jeet Kune Do rejects all restrictions imposed by form and formality and emphasizes the clever use of the mind and body to defend and attack.\nPart 2 "Jeet Kune Do \u2014 The Fundamentals"','An instructor should exemplify the things he seeks to teach. It will be of great advantage if you yourself can do all you ask of your students and more.\nPart 5 "On training in Jeet Kune Do"','As an instructor, you must be able to distinguish between poor performance caused by lack of ability or aptitude on the part of the student and poor performance caused by lack of effort. You should treat the first with patience and the latter with firmness. You must never apply sarcasm and ridicule.\nPart 5 "On training in Jeet Kune Do"','Even today, I dare not say that I have reached a state of achievement. I\'m still learning, for learning is boundless.\nPart 6 "Beyond System \u2014 The Ultimate Source of Jeet Kune Do"','The man who is really serious, with the urge to find out what truth is, has no style at all. He lives only in what is.\nPart 6 "Beyond System \u2014 The Ultimate Source of Jeet Kune Do"','Take inventory of everyone with whom you have contact.\nPart 6 "Beyond System \u2014 The Ultimate Source of Jeet Kune Do"','Faith is a state of mind that can be conditioned through self-discipline. Faith will accomplish.\nPart 6 "Beyond System \u2014 The Ultimate Source of Jeet Kune Do"','Faith makes it possible to achieve that which man\'s mind can conceive and believe.\nPart 6 "Beyond System \u2014 The Ultimate Source of Jeet Kune Do"','Possession of anything begins in the mind.\nPart 6 "Beyond System \u2014 The Ultimate Source of Jeet Kune Do"','Thoughts are things.\nPart 6 "Beyond System \u2014 The Ultimate Source of Jeet Kune Do"','Make at least one definite move daily toward your goal.\nPart 6 "Beyond System \u2014 The Ultimate Source of Jeet Kune Do"','The intangible represents the real power of the universe. It is the seed of the tangible.\nPart 6 "Beyond System \u2014 The Ultimate Source of Jeet Kune Do"','The spirit of the individual is determined by his dominating thought habits.\nPart 6 "Beyond System \u2014 The Ultimate Source of Jeet Kune Do"',"Emptiness the starting point. \u2014 In order to taste my cup of water you must first empty your cu","Life is wide, limitless. There is no border, no frontier.\np 2","Life lives; and in the living flow, no questions are raised. The reason is that life is a living now! So, in order to live life whole-heartedly, the answer is life simply is.","The meaning of life is that it is to be lived, and it is not to be traded and conceptualized and squeezed into a pattern of systems.",'The aphorism "as a man thinketh in his heart so is he" contains the secret of life.',"Meaning is found in relationshi","Life is never stagnation. It is constant movement, unrhythmic movement, as we as constant change. Things live by moving and gain strength as they go.","Life itself is your teacher, and you are in a state of constant learning.","The primary reality is not what I think, but that I live, for those also live who do not think.",'The timeless moment. \u2014 The "moment" has no yesterday or tomorrow. It is not the result of thought and therefore has no time.',"Knowledge, surely, is always of time, whereas knowing is not of time. Knowledge is from a source, from accumulation, from conclusion, while knowing is a movement.","To realize freedom the mind has to learn to look at life, which is a vast movement, without the bondage of time, for freedom lies beyond the field of consciousness \u2014 care for watching, but don't stop and interpret \"I am free,\" then you're living in a memory of something that has gone before.","To spend time is to pass it in a specified manner. To waste time is to expend it thoughtlessly or carelessly. We all have time to spend or waste, and it is our decision what to do with it. But once passed, it is gone forever.","Time means a lot to me because, you see, I, too, am also a learner and am often lost in the joy of forever developing and simplifying. If you love life, don't waste time, for time is what life is made up of.","Be aware of doing your best to understand the ROOT in life, and realize the DIRECT and the INDIRECT are in fact a complementary WHOLE. It is to see things as they are and not to become attached to anything \u2014 to be unconscious meant to be innocent of the working of a relative (empirical) mind \u2014 where there is no abiding of thought anywhere on anything \u2014 this is being unbound. This not abiding anywhere is the root of our life.","Concentration is the ROOT of all the higher abilities in man.","Seek to understand the root. \u2014 It is futile to argue as to which single leaf, which design of branch, or which attractive flower you like; when you understand the root, you understand all its blossoming.",'What we are after is the ROOT and not the branches. The root is the real knowledge; the branches are surface knowledge. Real knowledge breeds "body feel" and personal expression; surface knowledge breeds mechanical conditioning and imposing limitation and squelches creativity.',"Flow in the living moment. \u2014 We are always in a process of becoming and NOTHING is fixed. Have no rigid system in you, and you'll be flexible to change with the ever changing. OPEN yourself and flow, my friend. Flow in the TOTAL OPENNESS OF THE LIVING MOMENT. If nothing within you stays rigid, outward things will disclose themselves. Moving, be like water. Still, be like a mirror. Respond like an echo.","You cannot force the Now. \u2014 But can you neither condemn nor justify and yet be extraordinarily alive as you walk on? You can never invite the wind, but you must leave the window open.","The Moment is freedom. \u2014 I couldn't live by a rigid schedule. I try to live freely from moment to moment, letting things happen and adjusting to them.","The Now is indivisible. \u2014 Completeness, the now, is an absence of the conscious mind to strive to divide that which is indivisible. For once the completeness of things is taken apart it is no longer complete.","The Western approach to reality is mostly through theory, and theory begins by denying reality \u2014 to talk about reality, to go around reality, to catch anything that attracts our sense-intellect and abstract it away from reality itself. Thus philosophy begins by saying that the outside world is not a basic fact, that its existence can be doubted and that every proposition in which the reality of the outside world is affirmed is not an evident proposition but one that needs to be divided, dissected and analyzed. It is to stand consciously aside and try to square a circle.",'In Science we have finally come back to the pre-Socratic philosopher Heraclitus, who said everything is flow, flux, process. There are no "things." NOTHINGNESS in Eastern language is "no-thingness". We in the West think of nothingness as a void, an emptiness, an nonexistence. In Eastern philosophy and modern physical science, nothingness \u2014 no-thingness \u2014 is a form of process, ever moving.','What IS is more important than WHAT SHOULD BE. To many people are looking at "what is" from a position of thinking "what should be."',"Conditioning obstructs our view of reality. \u2014 We do not see IT in its suchness because of our indoctrination, crooked and twisted.","True thusness is without defiling thought; it cannot be known through conception and thought.",'Reality is apparent when one ceases to compare. \u2014 There is "what is" only when there is no comparison at all, and to live with what is, is to be peaceful.','Reality is being itself. \u2014 It is being itself, in becoming itself. Reality in its isness, the "isness" of a thing. Thus isness is the meaning \u2014 having freedom in its primary sense \u2014 not limited by attachments, confinements, partialization, complexities.',"A self-willed man obeys a different law, the one law I, too, hold absolutely sacred \u2014 the human law in himself, his own individual will.","One should be in harmony with, not in opposition to, the strength and force of the opposition. This means that one should do nothing that is not natural or spontaneous; the important thing is not to strain in any way.","The dualistic philosophy reigned supreme in Europe, dominating the development of Western science. But with the advent of atomic physics, findings based on demonstrable experiment were seen to negate the dualistic theory, and the trend of thought since then has been back to the monistic conception of the ancient Taoists.","If thought exists, I who think and the world about which I think also exist; the one exists but for the other, having no possible separation between them. Therefore, the world and I are both in active correlation; I am that which sees the world, and the world is that which is seen by me. I exist for the world and the world exists for me. \u2026 One sure and primary and fundamental fact is the joint existence of a subject and of its world. The one does not exist without the other. I acquire no understanding of myself except as I take account of objects, of the surroundings. I do not think unless I think of things \u2014 and there I find myself.","When we hold to the core, the opposite sides are the same if they are seen from the center of the moving circle. I do not experience; I am experience. I am not the subject of experience; I am that experience. I am awareness. Nothing else can be I or can exist.","Taoist philosophy \u2026 is essentially monistic. \u2026 Matter and energy, Yang and Yin, heaven and earth, are conceived of as essentially one or as two coexistent poles of one indivisible whole.","Voidness is that which stands right in the middle between this and that. The void is all-inclusive; having no opposite, there is nothing which it excludes or opposes. The all illuminating light shines and is beyond the movement of the opposites.","Like everyone else you want to learn the way to win. But never to accept the way to lose. To accept defeat \u2014 to learn to die \u2014 is to be liberated from it. Once you accept, you are free to flow and to harmonize. Fluidity is the way to an empty mind. You must free your ambitious mind and learn the art of dying.","True thusness is the substance of thought, and thought is the function of true thusness. There is no thought except that of true thusness. Thusness does not move, but its motion and function are inexhaustible.","Liberate yourself from concepts and see the truth with your own eyes. \u2014 It exists HERE and NOW; it requires only one thing to see it: openness, freedom \u2014 the freedom to be open and not tethered by any ideas, concepts, etc. \u2026 When our mind is tranquil, there will be an occasional pause to its feverish activities, there will be a let-go, and it is only then in the interval between two thoughts that a flash of UNDERSTANDING \u2014 understanding, which is not thought \u2014 can take place.","Balance your thoughts with action. \u2014 If you spend too much time thinking about a thing, you'll never get it done.","Concepts vs. self-actualization. \u2014 Instead of dedicating your life to actualize a concept of what you should be like, ACTUALIZE YOURSELF. The process of maturing does not mean to become a captive of conceptualization. It is to come to the realization of what lies in our innermost selves.","Life is better lived than conceptualized. \u2014 This writing can be less demanding should I allow myself to indulge in the usual manipulating game of role creation. Fortunately for me, my self-knowledge has transcended that and I've come to understand that life is best to be lived \u2014 not to be conceptualized. If you have to think, you still do not understand.","Knowledge will give you power, but character respect.","What you HABITUALLY THINK largely determines what you will ultimately become.","Know the difference between a catastrophe and an inconvenience. \u2014 To realize that it's just an inconvenience, that it is not a catastrophe, but just an unpleasantness, is part of coming into your own, part of waking u","The change is from inner to outer. \u2014 We start by dissolving our attitude not by altering outer conditions.","Choose the positive. \u2014 You have choice \u2014 you are master of your attitude \u2014 choose the POSITIVE, the CONSTRUCTIVE. Optimism is a faith that leads to success.","Cease negative mental chattering. \u2014 If you think a thing is impossible, you'll make it impossible. Pessimism blunts the tools you need to succeed.","A goal is not always meant to be reached, it often serves simply as something to aim at.","Don't fear failure. \u2014 Not failure, but low aim, is the crime. In great attempts it is glorious even to fail."],t.s)
$.acl=function(){var s="Chances are if you' ve seen one shopping center, you've seen a mall.",r="At the boxing match, the dad got into the popcorn line and the line for hot dogs, but he wanted to stay out of the punchline.",q="A red and a blue ship have just collided in the Caribbean. Apparently the survivors are marooned.",p="Where do young cows eat lunch? In the calf-ateria.",o="If a child refuses to sleep during nap time, are they guilty of resisting a rest?",n="Why can\u2019t you hear a pterodactyl go to the bathroom? The p is silent.",m="What did the grape do when he got stepped on? He let out a little wine."
return H.a(["What concert only costs 45 cents to get in?\r\nA 50 cent concert with a guest appearance from nickelback","What did one dorito farmer say to the other dorito farmer?\r\nCool Ranch","Did you hear about the new restaurant on the moon? The food is great, but there\u2019s just no atmosphere.","What do you do when your bunny gets wet? You get your hare dryer.","My boss told me that he was going to fire the person with the worst posture. I have a hunch, it might be me.","What's the best thing about elevator jokes? They work on so many levels.","My sea sickness comes in waves.","What did the fish say when it swam into a wall? Damn!","I was going to get a brain transplant, but I changed my mind","Do I enjoy making courthouse puns? Guilty",s,"What do you get when you cross a bee and a sheep? A bah-humbug.\r\n","They're making a movie about clocks. It's about time",r,"You can't run through a camp site. You can only ran, because it's past tents.","Today a man knocked on my door and asked for a small donation towards the local swimming pool. I gave him a glass of water.","What is a vampire's favorite fruit? A blood orange.","To the person who stole my anti-depressant pills: I hope you're happy now.","I burned 2000 calories today, I left my food in the oven for too long.","What do you call an alligator in a vest? An in-vest-igator!",q,p,"What\u2019s the advantage of living in Switzerland? Well, the flag is a big plus.","Why did the feline fail the lie detector test? Because he be lion.","How was the snow globe feeling after the storm? A little shaken.",o,"Conjunctivitis.com \u2013 now that\u2019s a site for sore eyes.","What did Romans use to cut pizza before the rolling cutter was invented? Lil Caesars","What did celery say when he broke up with his girlfriend? She wasn't right for me, so I really don't carrot all.","So, I heard this pun about cows, but it\u2019s kinda offensive so I won\u2019t say it. I don\u2019t want there to be any beef between us. ","What type of music do balloons hate? Pop music!","Why did the octopus beat the shark in a fight? Because it was well armed.","What do you call a beehive without the b's? An eehive.","How did Darth Vader know what Luke was getting for Christmas? He felt his presents.","Why can't a bicycle stand on its own? It's two-tired.","Parallel lines have so much in common. It\u2019s a shame they\u2019ll never meet.","What did the father tomato say to the baby tomato whilst on a family walk? Ketchup.","What do you call a fat psychic? A four-chin teller.","What do bees do after they are married? They go on a honeymoon.","Why do cows wear bells? Because their horns don't work.","How do you make Lady Gaga cry? Poker face. ",n,"I have kleptomania, but when it gets bad, I take something for it.","Whiteboards ... are remarkable.","Why do fish live in salt water? Because pepper makes them sneeze!","Why do scuba divers fall backwards into the water? Because if they fell forwards they\u2019d still be in the boat.","Two peanuts were walking down the street. One was a salted","I used to work for a soft drink can crusher. It was soda pressing.","Ever wondered why bees hum? It's because they don't know the words.",m,"Recent survey revealed 6 out of 7 dwarf's aren't happy.","How much does a hipster weigh? An instagram.",s,"How come a man driving a train got struck by lightning? He was a good conductor.","Don\u2019t interrupt someone working intently on a puzzle. Chances are, you\u2019ll hear some crosswords.",n,"It's only a murder of crows if there's probable caws.",o,"What do you call a cow with two legs? Lean beef.","How come the stadium got hot after the game? Because all of the fans left.","Egyptians claimed to invent the guitar, but they were such lyres.\ufeff","Have you heard about corduroy pillows?  They're making headlines!","What kind of tree fits in your hand? A palm tree!","My wife is on a tropical fruit diet, the house is full of stuff. It is enough to make a mango crazy.","The Swiss must've been pretty confident in their chances of victory if they included a corkscrew in their army knife.",q,"What do you call a magician who has lost their magic? Ian.","What do you call an elephant that doesn\u2019t matter? An irrelephant.","Ben & Jerry's really need to improve their operation. The only way to get there is down a rocky road.","Q: What did the spaghetti say to the other spaghetti?\r\nA: Pasta la vista, baby!","What kind of magic do cows believe in? MOODOO.","Some people eat light bulbs. They say it's a nice light snack.",p,"Wife told me to take the spider out instead of killing it... We had some drinks, cool guy, wants to be a web developer.","What do you get when you cross a snowman with a vampire? Frostbite.",'Guy told me today he did not know what cloning is. I told him, "that makes 2 of us."',"Mahatma Gandhi, as you know, walked barefoot most of the time, which produced an impressive set of calluses on his feet. \r\nHe also ate very little, which made him rather frail and with his odd diet, he suffered from bad breath. \r\nThis made him a super calloused fragile mystic hexed by halitosis.","Why don\u2019t skeletons ever go trick or treating? Because they have nobody to go with.","Did you know the first French fries weren't actually cooked in France? They were cooked in Greece.","You know that cemetery up the road? People are dying to get in there.","They tried to make a diamond shaped like a duck. It quacked under the pressure.","My dog used to chase people on a bike a lot. It got so bad I had to take his bike away.","Wife: Honey I\u2019m pregnant.\r\n\r\nMe: Well\u2026. what do we do now?\r\n\r\nWife: Well, I guess we should go to a baby doctor.\r\n\r\nMe: Hm.. I think I\u2019d be a lot more comfortable going to an adult doctor.","What happens to a frog's car when it breaks down? It gets toad.","What do you call a bee that lives in America? A USB.","What do you call a fly without wings? A walk.","I tried to write a chemistry joke, but could never get a reaction.","R.I.P. boiled water. You will be mist.","What did the mountain climber name his son? Cliff.","What did the late tomato say to the early tomato? I\u2019ll ketch up","A cannibal is someone who is fed up with people.",m,"What do you call your friend who stands in a hole? Phil.","A Skeleton walked into a bar he said I need a beer and a mop","I bought shoes from a drug dealer once. I don't know what he laced them with, but I was tripping all day.",r,"Why are graveyards so noisy? Because of all the coffin."," I never wanted to believe that my Dad was stealing from his job as a road worker. But when I got home, all the signs were there.\r\n\r\n","This morning I was wondering where the sun was, but then it dawned on me.","What do you call an Argentinian with a rubber toe? Roberto","What did the Zen Buddist say to the hotdog vendor? Make me one with everything.","What do you get when you cross a chicken with a skunk? A fowl smell!"],t.s)}()
